import React from 'react';
import { motion } from 'framer-motion';

const Projects = () => {
  const projects = [
    {
      title: "E-Commerce Platform",
      category: "Web Development",
      image: "üíª",
      description: "Modern e-commerce platform built with React and Node.js",
      technologies: ["React", "Node.js", "MongoDB", "Stripe"],
      color: "from-cyan-400 to-blue-500"
    },
    {
      title: "Mobile Banking App",
      category: "Mobile Development",
      image: "üì±",
      description: "Secure mobile banking application with biometric authentication",
      technologies: ["React Native", "Firebase", "Biometrics"],
      color: "from-blue-400 to-purple-500"
    },
    {
      title: "Gaming Dashboard",
      category: "UI/UX Design",
      image: "üéÆ",
      description: "Interactive gaming dashboard with real-time statistics",
      technologies: ["Figma", "React", "Chart.js", "WebSocket"],
      color: "from-purple-400 to-pink-500"
    },
    {
      title: "YouTube Analytics",
      category: "Content Creation",
      image: "üìä",
      description: "Analytics dashboard for YouTube content creators",
      technologies: ["YouTube API", "React", "D3.js", "Node.js"],
      color: "from-pink-400 to-red-500"
    },
    {
      title: "Portfolio Website",
      category: "Web Design",
      image: "üåê",
      description: "Modern portfolio website with interactive animations",
      technologies: ["React", "Framer Motion", "Tailwind"],
      color: "from-green-400 to-teal-500"
    },
    {
      title: "Social Media App",
      category: "Full Stack",
      image: "üì≤",
      description: "Social networking platform with real-time messaging",
      technologies: ["MERN Stack", "Socket.io", "AWS"],
      color: "from-orange-400 to-yellow-500"
    }
  ];

  return (
    <section className="py-20 px-6 relative overflow-hidden">
      {/* Background Elements */}
      <div className="absolute inset-0">
        <div className="absolute top-20 right-20 w-96 h-96 bg-cyan-500/5 rounded-full blur-3xl"></div>
        <div className="absolute bottom-20 left-20 w-80 h-80 bg-purple-500/5 rounded-full blur-3xl"></div>
      </div>

      <div className="max-w-7xl mx-auto relative z-10">
        {/* Section Header */}
        <motion.div
          className="text-center mb-16"
          initial={{ opacity: 0, y: 50 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ duration: 1 }}
          viewport={{ once: true }}
        >
          <h2 className="text-4xl md:text-5xl font-bold text-white mb-4">
            Latest <span className="text-cyan-400">Project</span>
          </h2>
          <p className="text-gray-300 text-lg max-w-2xl mx-auto">
            Showcasing my recent work and creative projects across different domains
          </p>
        </motion.div>

        {/* Projects Grid */}
        <div className="grid md:grid-cols-2 lg:grid-cols-3 gap-8">
          {projects.map((project, index) => (
            <motion.div
              key={project.title}
              className="gaming-card overflow-hidden group cursor-pointer"
              initial={{ opacity: 0, y: 50, rotateX: -15 }}
              whileInView={{ opacity: 1, y: 0, rotateX: 0 }}
              transition={{ delay: index * 0.1, duration: 0.8 }}
              viewport={{ once: true }}
              whileHover={{ 
                scale: 1.05,
                rotateY: 5,
                boxShadow: "0 25px 70px rgba(0, 255, 255, 0.2)"
              }}
            >
              {/* Project Image/Icon */}
              <div className={`relative h-48 bg-gradient-to-br ${project.color} flex items-center justify-center overflow-hidden`}>
                <motion.div
                  className="text-6xl"
                  whileHover={{ scale: 1.2, rotate: 10 }}
                  transition={{ duration: 0.3 }}
                >
                  {project.image}
                </motion.div>

                {/* Overlay */}
                <motion.div
                  className="absolute inset-0 bg-black/60 flex items-center justify-center opacity-0 group-hover:opacity-100 transition-opacity duration-300"
                >
                  <div className="flex space-x-4">
                    <motion.button
                      className="px-4 py-2 bg-cyan-400 text-gray-900 rounded-lg font-semibold hover:bg-cyan-300 transition-colors"
                      whileHover={{ scale: 1.1 }}
                      whileTap={{ scale: 0.95 }}
                    >
                      View Live
                    </motion.button>
                    <motion.button
                      className="px-4 py-2 border-2 border-cyan-400 text-cyan-400 rounded-lg font-semibold hover:bg-cyan-400 hover:text-gray-900 transition-all duration-300"
                      whileHover={{ scale: 1.1 }}
                      whileTap={{ scale: 0.95 }}
                    >
                      GitHub
                    </motion.button>
                  </div>
                </motion.div>
              </div>

              {/* Project Content */}
              <div className="p-6">
                {/* Category */}
                <span className="text-cyan-400 text-sm font-semibold uppercase tracking-wide">
                  {project.category}
                </span>

                {/* Title */}
                <h3 className="text-xl font-bold text-white mt-2 mb-3 group-hover:text-cyan-400 transition-colors duration-300">
                  {project.title}
                </h3>

                {/* Description */}
                <p className="text-gray-300 text-sm leading-relaxed mb-4">
                  {project.description}
                </p>

                {/* Technologies */}
                <div className="flex flex-wrap gap-2">
                  {project.technologies.map((tech, techIndex) => (
                    <motion.span
                      key={tech}
                      className="px-3 py-1 bg-gray-800/50 border border-cyan-400/20 text-cyan-400 text-xs rounded-full hover:border-cyan-400/50 transition-colors duration-300"
                      initial={{ opacity: 0, scale: 0.8 }}
                      whileInView={{ opacity: 1, scale: 1 }}
                      transition={{ delay: index * 0.1 + techIndex * 0.05, duration: 0.3 }}
                      viewport={{ once: true }}
                      whileHover={{ scale: 1.1 }}
                    >
                      {tech}
                    </motion.span>
                  ))}
                </div>
              </div>

              {/* Glow Effect */}
              <motion.div
                className={`absolute inset-0 bg-gradient-to-r ${project.color} opacity-0 group-hover:opacity-5 transition-opacity duration-500 pointer-events-none`}
              />
            </motion.div>
          ))}
        </div>

        {/* View All Projects Button */}
        <motion.div
          className="text-center mt-16"
          initial={{ opacity: 0, y: 30 }}
          whileInView={{ opacity: 1, y: 0 }}
          transition={{ delay: 0.8, duration: 0.8 }}
          viewport={{ once: true }}
        >
          <motion.button
            className="gaming-btn font-semibold px-10 py-4"
            whileHover={{ scale: 1.05 }}
            whileTap={{ scale: 0.95 }}
          >
            View All Projects
          </motion.button>
        </motion.div>
      </div>
    </section>
  );
};

export default Projects;
